-- delete all demo records with a simple sql that contains cascade delete constraints
DELETE FROM app_portfolio.user_account WHERE username like 'Demo%';
-- insert demo user accounts
-- insert app records for all user accounts and without and user preferences
SELECT ua.id, a.id, SYSDATE()
FROM app_portfolio.user_account ua,
     app_portfolio.app a
WHERE ua.username LIKE 'Demo%'
AND   a.id >0;
-- insert user settings for app2
-- insert random user account likes
-- order by random and set limit to 500
SELECT ua1.id, ua2.id,SYSDATE()
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%'
ORDER BY RAND()
LIMIT 500;
-- insert random user account view with user account, without user variables
-- order by random and set limit to 500
SELECT ua1.id, ua2.id,NULL,NULL,NULL,NULL,SYSDATE()
FROM   app_portfolio.user_account ua1,
	   app_portfolio.user_account ua2
WHERE ua1.username like 'Demo%'
AND ua2.username like 'Demo%'
ORDER BY RAND()
LIMIT 500;
-- insert random user account views anonymous, without user variables
